- input: "TEXT\x1CC00167213\x1C.TEXT\x1C\x1CF3XA\x1COn April 20, 2008, $250 in funds
    belong to the Oklahoma County Republican Party was deposited in error (via credit
    card deposit) into the committee's bank account. On April 22, 2008 these funds
    were paid to the Oklahoma County Republican Party.  Neither the receipt or the
    disbursement have been included in this report.  While in the committee's account
    none of the $250 was used to influence the election or defeat of any Federal Candidate.
    \                                                                                  The
    amended report is filed in response to the FEC's letter dated July 30, 2008.  The
    late response is the result of staff error, and committee personnel being out
    of the office at the national convention."
